import React, { useState } from "react";
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from "recharts";
import universityData from "./UniversityData";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(universityData[0]);
  const [selectedSubject, setSelectedSubject] = useState(selectedUniversity.subjects[0]);
  const [selectedStudentType, setSelectedStudentType] = useState("International");
  const [cgpa, setCgpa] = useState(0);
  const [sat, setSat] = useState(0);

  const selectedSubjectData = selectedUniversity.subjectDetails[selectedSubject];

  const estimateAdmissionProbability = () => {
    if (!selectedSubjectData || !cgpa || !sat) return "Enter both CGPA and SAT";
    const gpaCutoff = parseFloat(selectedSubjectData.gpaCutoff);
    const satCutoff = parseInt(selectedSubjectData.satCutoff);
    if (cgpa >= gpaCutoff && sat >= satCutoff) return "High";
    if (cgpa >= gpaCutoff - 0.3 || sat >= satCutoff - 50) return "Moderate";
    return "Low";
  };

  return (
    <div className="App" style={{ fontFamily: "Arial", padding: "20px" }}>
      <h1>QS World University Rankings Explorer</h1>

      <label>Select University:</label>
      <select
        value={selectedUniversity.name}
        onChange={(e) => {
          const university = universityData.find((u) => u.name === e.target.value);
          setSelectedUniversity(university);
          setSelectedSubject(university.subjects[0]);
        }}
      >
        {universityData.map((u) => (
          <option key={u.name} value={u.name}>{u.name}</option>
        ))}
      </select>

      <div style={{ marginTop: "10px" }}>
        <label>Student Type:</label>
        <button onClick={() => setSelectedStudentType("International")}>International</button>
        <button onClick={() => setSelectedStudentType("Domestic")}>Domestic</button>
      </div>

      <h2>{selectedUniversity.name}</h2>
      <p><strong>General QS Rank:</strong> {selectedUniversity.generalRank}</p>

      <label>Select Subject:</label>
      <select
        value={selectedSubject}
        onChange={(e) => setSelectedSubject(e.target.value)}
      >
        {selectedUniversity.subjects.map((s) => (
          <option key={s} value={s}>{s}</option>
        ))}
      </select>

      <h3>{selectedSubject}</h3>
      <p><strong>QS Subject Rank:</strong> {selectedSubjectData?.qsSubjectRank}</p>
      <p><strong>Start Date:</strong> {selectedSubjectData?.startDate}</p>
      <p><strong>Fees:</strong> {selectedSubjectData?.fees}</p>
      <p><strong>Eligibility:</strong> {selectedSubjectData?.eligibility?.[selectedStudentType]}</p>
      <p><strong>Intakes per Year:</strong> {selectedSubjectData?.intakes}</p>
      <p><strong>Application Deadlines:</strong> {selectedSubjectData?.deadlines}</p>
      <p><strong>Scholarship Info:</strong> {selectedSubjectData?.scholarship || "Not Available"}</p>

      <h4>Student Inputs</h4>
      <label>Enter CGPA (out of 10): </label>
      <input
        type="number"
        value={cgpa}
        onChange={(e) => setCgpa(parseFloat(e.target.value))}
      />
      <br />
      <label>Enter SAT Score: </label>
      <input
        type="number"
        value={sat}
        onChange={(e) => setSat(parseInt(e.target.value))}
      />

      <p><strong>Estimated Admission Probability:</strong> {estimateAdmissionProbability()}</p>

      <p><strong>Course Link:</strong> <a href={selectedSubjectData?.courseLink} target="_blank" rel="noopener noreferrer">Visit</a></p>

      <h4>QS Rankings (Last 5 Years)</h4>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={selectedSubjectData?.rankingHistory}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="year" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="qsRank" stroke="#8884d8" name="QS Rank" />
          <Line type="monotone" dataKey="gpaCutoff" stroke="#82ca9d" name="GPA Cutoff" />
          <Line type="monotone" dataKey="satCutoff" stroke="#ff7300" name="SAT Cutoff" />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}

export default App;
